import React from 'react';
import styled from 'styled-components';

const ChattingInputBlock = styled.div`
  width: 100%;
  border: 1px solid black;
  height: 80px;
`;

const ChattingInput = () => {
  return <ChattingInputBlock></ChattingInputBlock>;
};

export default ChattingInput;
